/** weight -> cost */
private static int encodeWeight(long value) {
  if (value < Integer.MIN_VALUE || value > Integer.MAX_VALUE) {
    throw new UnsupportedOperationException("cannot encode value: " + value);
  }
  return (int)value;
}

